    "# Fungsi untuk membersihkan nama kolom\n",
    "def clean_col_names(col_name):\n",
    "    # Hilangkan semua karakter non-alphanumerik dan ganti dengan underscore\n",
    "    cleaned_name = re.sub(r'[^a-zA-Z0-9_]+', '_', col_name)\n",
    "    # Ubah ke lowercase\n",
    "    cleaned_name = cleaned_name.lower()\n",
    "    return cleaned_name\n",
    "\n",
    "# Membersihkan semua nama kolom\n",
    "df.columns = [clean_col_names(col) for col in df.columns]"
