    "data_cleaned = data.copy()\n",
    "# Menangani outlier\n",
    "if all(col in data_cleaned.columns for col in kolom_numerik):\n",
    "    for col in kolom_numerik:\n",
    "        if col in ['seconds_of_use', 'age', 'customer_value']:\n",
    "            data_cleaned[col] = data_cleaned[col].astype('float64')\n",
    "        \n",
    "        # Metode IQR untuk penanganan outlier\n",
    "        Q1 = data_cleaned[col].quantile(0.25)\n",
    "        Q3 = data_cleaned[col].quantile(0.75)\n",
    "        IQR = Q3 - Q1\n",
    "        lower_bound = Q1 - 1.5 * IQR\n",
    "        upper_bound = Q3 + 1.5 * IQR\n",
    "        \n",
    "        # Capping dengan IQR\n",
    "        data_cleaned[col] = np.clip(data_cleaned[col], lower_bound, upper_bound)\n",
    "        print(f\"Outlier pada '{col}' di-capped pada: [{lower_bound:.2f}, {upper_bound:.2f}] (IQR Method)\")\n",
    "\n",
    "    print(\"\\nStatistik deskriptif setelah penanganan outlier:\")\n",
    "    print(data_cleaned[kolom_numerik].describe())\n",
